import { createSelector } from 'reselect';
import { initialState } from './reducers';

const selectCart = (state) => state.order || initialState;

const selectOrder = createSelector(selectCart, (substate) => substate);
const selectOrderData = createSelector(selectCart, (substate) => substate.data.order);
const selectSuccessOrder = createSelector(selectCart, (substate) => substate);
const selectLoadingOrder = createSelector(selectCart, (substate) => substate);
const selectErrorOrder = createSelector(selectCart, (substate) => substate);

export default selectOrder;
export { selectOrder };
